const Navbar = () => {

    return (
        <nav className="custom-navbar">
            <a href="#home" className="nav-link active">Home</a>
            <a href="#news" className="nav-link">Chat</a>
            <a href="#contact" className="nav-link">Videos</a>
            <a href="#about" className="nav-link">Documents</a>
            <a href="#services" className="nav-link">Notes</a>
        </nav>


    );
};

export default Navbar;
